class Solution(object):
    def validPalindrome(self, s):
        l = len(s)
        index1 = 0
        index2 = l - 1
        while index2 > index1:
            if s[index2] == s[index1]:
                index1 += 1
                index2 -= 1
                continue
            else:
                if s[index1 + 1] == s[index2] and s[index1] != s[index2 - 1]:
                    index1 = index1 + 1
                    while index1 < index2 and s[index1] == s[index2]:
                        index1 += 1
                        index2 -= 1
                    if index2 > index1:
                        return False
                    else:
                        return True
                elif s[index1 + 1] != s[index2] and s[index1] == s[index2-1]:
                    index2 = index2 - 1
                    while index1 < index2 and s[index1] == s[index2]:
                        index1 += 1
                        index2 -= 1
                    if index2 > index1:
                        return False
                    else:
                        return True
                elif s[index1 + 1] == s[index2] and s[index1] == s[index2-1]:
                    t1 = index1 + 1
                    t2 = index2
                    while t1 < t2 and s[t1] == s[t2]:
                        t1 += 1
                        t2 -= 1
                    if t2 > t1:
                        ret1 = False
                    else:
                        ret1 = True
                    if ret1:
                        return True
                    index2 = index2 - 1
                    while index1 < index2 and s[index1] == s[index2]:
                        index1 += 1
                        index2 -= 1
                    if index2 > index1:
                        ret2 = False
                    else:
                        ret2 =True
                    if ret2:
                        return True
                    else:
                        return False
                else:
                    return False
        return True






